$(document).ready(function() {
    $("#admins").on('click','.delbutton',function(){
        var element = $(this);
        var del_id = element.attr("id");
        var info = 'id=' + del_id;
        if(confirm("Are you sure you want to delete this Admin?")){
            $.ajax({
                type: "GET",
                url: "delete-admin.php",
                data: info,
                success: function(){
                    alert("Admin deleted successfully!");
                }
            });
        }
        return false;
    });
    console.log("Hello");
});